import React, { Component, Fragment } from 'react'
import { makeStyles } from "@material-ui/core/styles";
import { CardMedia, Typography } from '@material-ui/core';
import '../components/Carrusel/Carrusel.css'

const s = {
    container: "screenW screenH dGray col ",
    header: "flex1 fCenter fSize2",
    main: "flex8 white",
    footer: "flex1 fCenter",
    image: "fullW fullH imgCover"
};
  
export class ConsultaVirtual extends Component {
    componentDidMount(){
        document.getElementById("loader").style.display = "none";
    }
    componentDidUpdate(){
        document.getElementById("loader").style.display = "initial";
    }
    render() {
        return (
            <div>
                <img className={s.image} src="https://www.help.cl/wp-content/themes/help_template/assets/img/teleconsulta/banner-consulta-medica-virtual-1366x300.jpg" ></img>
                <div>
                <Typography variant="h1" color="textPrimary" >Obtenga la atención de un médico online ante situaciones de salud menores.</Typography>
                <Typography variant="h3" color="textPrimary">• RESFRÍO COMÚN • GRIPE • FIEBRE • OTITIS • DOLOR DE GARGANTA • ALERGIA</Typography>
                <Typography variant="h3" color="textPrimary">• CEFALEA • LUMBAGO • GASTROENTERITIS • MOLESTIA URINARIA • TOS</Typography>
                
                </div>
            </div>
            
        )
    }
}

export default ConsultaVirtual
